	(169,'elementor_remote_info_feed_data','a:5:{i:0;a:5:{s:5:\"title\";s:67:\"12 New Full Kits That Will Accelerate Your Website Creation Process\";s:7:\"excerpt\";s:368:\"Building a professional, & beautiful website should be as hassle-free as possible. That is where website kits come in  to help you get started faster using stunning, pre-designed templates that allow you to achieve professional looking websites. Now imagine an even more convenient way to use these kits as we introduce 12 new Basic Website Kits  6 Free & 6 Pro.\";s:7:\"created\";i:1650351364;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:146:\"https://elementor.com/blog/12-kits-to-accelerate-website-creation-process/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:54:\"Elementor Websites of the Month: Spotlight on Cannabis\";s:7:\"excerpt\";s:311:\"To introduce you to new opportunities, inspire you with unique creative ideas, and ignite your already sparkling imagination, we present our pick of the top cannabis-inspired websites built with Elementor. Explore this new breed of web designs for one of the most lucrative and fastest-growing industries today.\";s:7:\"created\";i:1649854378;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/cannabis-websites-showcase/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:76:\"WooCommerce Thank You Page: Tips To Make Your Customers Experience Better\";s:7:\"excerpt\";s:219:\"Your WooCommnerce Thank You page can encourage customers to engage further with your brand and generate more revenue. Our guide will help you customize an effective thank you page with Elementor and maximize your sales.\";s:7:\"created\";i:1649769142;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:135:\"https://elementor.com/blog/optimize-woocommerce-thank-you-page/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:37:\"Is Cloud Hosting for Websites Secure?\";s:7:\"excerpt\";s:235:\"Hosting security plays a key role in keeping your site safe from malicious actors. Because of the way that cloud hosting operates, it offers security benefits that go beyond traditional hosting. In this post, we explore these benefits.\";s:7:\"created\";i:1649657715;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/cloud-hosting-secure/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:32:\"What Is Brutalism in Web Design?\";s:7:\"excerpt\";s:207:\"Brutalism is a special breed of web design, working well for quirky, creative brands and individuals. However, this rule-bending design technique must be employed with care.Read this guide to find out how.\";s:7:\"created\";i:1649328837;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/brutalism-in-web-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','no'),
